(191, 1, '2017-05-31 20:03:50', 'Community Edition 1.9.3.3 and SUPEE-9767 Security Enhancements – 5/31/2017', 'Community Edition 1.9.3.3 and SUPEE-9767 includes critical security enhancements. Review the Security Center update for more information: https://magento.com/security/patches/supee-9767', 'https://magento.com/security/patches/supee-9767', 0, 0),
(192, 2, '2017-06-13 18:20:53', 'New Patch for PayPal Instant Payment Notification (IPN) Changes. Upgrade to 1.9.3.3 or SUPEE-8167 by June 30, 2017 to Avoid Service Disruptions – 6/13/2017', 'As of June 30, 2017, PayPal Instant Payment Notifications will no longer allow you to use HTTP to post messages back to PayPal for verification. To comply with these changes, all merchants using PayPal must upgrade to Community Edition 1.9.3.3 or apply the SUPEE-8167 patch. Updates must be in place by June 30, 2017 to avoid any service disruptions. The patch is available on the Community Edition Download Page (https://magento.com/tech-resources/download) and more information is available from PayPal at https://www.paypal-knowledge.com/infocenter/index?page=content&widgetview=true&id=FAQ1916&viewlocale=en_US\n\n', 'https://magento.com/tech-resources/download ', 0, 0),
(193, 4, '2017-07-05 03:55:37', 'Magento Business Intelligence Essentials: Now Available!', 'Magento Business Intelligence Essentials (BI) helps you and your teams to stay on top of the most important metrics to your business. Essentials works directly with your Magento order and customer data, and provides business insights far beyond what standard web analytics tools provide.\n\nWith Essentials, you can get up and running in only a few minutes and access over 75 pre-built reports instantly. Plus, it comes with a free 7-day trial where no credit card information is required. If you decide to stay, Essentials starts at just $100/month.\n\nFor more information, visit magento.com/products/business-intelligence/essentials.\n', 'https://magento.com/products/business-intelligence/essentials', 0, 0),
(194, 1, '2017-07-12 12:45:32', 'Community Edition 1.9.3.4 and SUPEE-9767 Version 2 Address Issues with May 31 Security Release', 'Community Edition 1.9.3.4 and SUPEE-9767 v2 (patch) are now available. The new release and updated patch address customer registration and other issues encountered by some merchants when using the original release. Please upgrade as soon as possible to keep your site secure. More information is available in the release notes at  http://devdocs.magento.com/guides/m1x/ce19-ee114/ce1.9_release-notes.html', 'http://devdocs.magento.com/guides/m1x/ce19-ee114/ce1.9_release-notes.html', 0, 0);
