(2, 'Amante', '', '3.png', '<p><span>Shop the amant&eacute; Aura collection, exclusively available at m&amp;w online...</span></p>', 1, '2017-06-06 11:07:43', '2017-06-06 11:07:43'),
(3, 'Speedo', '', '2.png', '<p><span>Are you dedicated to the swim life?</span></p>\r\n<p>&nbsp;</p>\r\n<p><span>More....</span></p>', 1, '2017-06-06 11:03:47', '2017-06-06 11:03:47'),
(4, 'Jockey', '', '4.png', '<p><span>Don\'t let the fear of falling keep you from flying....</span></p>', 1, '2017-06-06 11:14:15', '2017-06-06 11:14:15'),
(5, 'Celvin Klein', '', '5.png', '<p><span>New collection of Calvin klein underwear 2017</span></p>', 1, '2017-06-06 11:11:51', '2017-06-06 11:11:51'),
(6, 'M&W', '', 'blog1.jpg', '<p>Over a dozen reusable components built to provide iconography, dropdowns, input groups, navigation, alerts, and much more.</p>', 1, '2017-06-06 11:15:42', '2017-06-06 11:15:42');
