(1, 'Footer Links', 'footer_links', '\n<ul>\n    <li><a href=\"{{store direct_url=\"about-magento-demo-store\"}}\">About Us</a></li>\n    <li><a href=\"{{store direct_url=\"customer-service\"}}\">Customer Service</a></li>\n<li class=\"last privacy\"><a href=\"{{store direct_url=\"privacy-policy-cookie-restriction-mode\"}}\">Privacy Policy</a></li>\r\n</ul>', '2017-03-15 10:25:49', '2017-03-15 10:25:49', 1),
(2, 'Footer Links Company', 'footer_links_company', '\n<div class=\"links\">\n    <div class=\"block-title\">\n        <strong><span>Company</span></strong>\n    </div>\n    <ul>\n        <li><a href=\"{{store url=\"\"}}about-magento-demo-store/\">About Us</a></li>\n        <li><a href=\"{{store url=\"\"}}contacts/\">Contact Us</a></li>\n        <li><a href=\"{{store url=\"\"}}customer-service/\">Customer Service</a></li>\n        <li><a href=\"{{store url=\"\"}}privacy-policy-cookie-restriction-mode/\">Privacy Policy</a></li>\n    </ul>\n</div>', '2017-03-15 10:25:49', '2017-03-15 10:25:49', 1),
(3, 'Cookie restriction notice', 'cookie_restriction_notice_block', '<p>This website requires cookies to provide all of its features. For more information on what data is contained in the cookies, please see our <a href=\"{{store direct_url=\"privacy-policy-cookie-restriction-mode\"}}\">Privacy Policy page</a>. To accept cookies from this site, please click the Allow button below.</p>', '2017-03-15 10:25:49', '2017-03-15 10:25:49', 1),
(4, 'contact info', 'contact-info', '<p><b>DieSachbearbeiter</b><br /> Choriner Stra&szlig;e 49<br /> 10435 Berlin<br /> E-Mail: moinsen@blindtextgenerator.com</p>\r\n<p>&nbsp;</p>\r\n<p>Please make sure that you are returning the product unwashed/free from dirt, along with the product tag, original invoice and original product packaging in the shipping box. Please give a call on 08050017676 &amp; send an e-mail to enquiry@m&amp;w.com to inform us about the returns immediately.</p>', '2017-04-18 10:32:57', '2017-06-22 23:33:08', 1),
(5, 'contact info map', 'contact-info-map', '<p><iframe style=\"border: 0;\" src=\"https://www.google.com/maps/embed?pb=!1m14!1m12!1m3!1d58947.80801462871!2d88.4007231!3d22.57020015!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!5e0!3m2!1sen!2sin!4v1492514299365\" height=\"350\" width=\"100%\"></iframe></p>', '2017-04-18 11:15:21', '2017-06-23 00:17:34', 1),
(6, 'TV Ad! FitForAll', 'tv_ad', '<!--p><iframe src=\"https://www.youtube.com/embed/5_k1Uovq4Hc?autoplay=0\" height=\"505\" width=\"100%\"></iframe></p-->\r\n<p><iframe src=\"https://www.youtube-nocookie.com/embed/5_k1Uovq4Hc?start=00&end=06&loop=1;rel=0?ecver=1\" height=\"720\" width=\"100%\"></iframe></p>', '2017-05-25 06:20:21', '2017-07-04 02:08:35', 1),
