INSERT INTO `cms_page` (`page_id`, `title`, `root_template`, `meta_keywords`, `meta_description`, `identifier`, `content_heading`, `content`, `creation_time`, `update_time`, `is_active`, `sort_order`, `layout_update_xml`, `custom_theme`, `custom_root_template`, `custom_layout_update_xml`, `custom_theme_from`, `custom_theme_to`) VALUES
(1, '404 Not Found 1', 'two_columns_right', 'Page keywords', 'Page description', 'no-route', NULL, '\n<div class=\"page-title\"><h1>Whoops, our bad...</h1></div>\n<dl>\n    <dt>The page you requested was not found, and we have a fine guess why.</dt>\n    <dd>\n        <ul class=\"disc\">\n            <li>If you typed the URL directly, please make sure the spelling is correct.</li>\n            <li>If you clicked on a link to get here, the link is outdated.</li>\n        </ul>\n    </dd>\n</dl>\n<dl>\n    <dt>What can you do?</dt>\n    <dd>Have no fear, help is near! There are many ways you can get back on track with Magento Store.</dd>\n    <dd>\n        <ul class=\"disc\">\n            <li><a href=\"#\" onclick=\"history.go(-1); return false;\">Go back</a> to the previous page.</li>\n            <li>Use the search bar at the top of the page to search for your products.</li>\n            <li>Follow these links to get you back on track!<br /><a href=\"{{store url=\"\"}}\">Store Home</a>\n            <span class=\"separator\">|</span> <a href=\"{{store url=\"customer/account\"}}\">My Account</a></li>\n        </ul>\n    </dd>\n</dl>\n', '2017-03-15 10:25:49', '2017-03-15 10:25:49', 1, 0, NULL, NULL, NULL, NULL, NULL, NULL),
(2, 'Home page', 'one_column', NULL, NULL, 'home', NULL, '<div class=\"page-title\">\r\n<h2>{{block type=\"core/template\" template=\"cms/home.phtml\"}}</h2>\r\n</div>', '2017-03-15 10:25:49', '2017-03-16 05:15:19', 1, 0, '<!--<reference name=\"content\">\r\n        <block type=\"catalog/product_new\" name=\"home.catalog.product.new\" alias=\"product_new\" template=\"catalog/product/new.phtml\" after=\"cms_page\">\r\n            <action method=\"addPriceBlockType\">\r\n                <type>bundle</type>\r\n                <block>bundle/catalog_product_price</block>\r\n                <template>bundle/catalog/product/price.phtml</template>\r\n            </action>\r\n        </block>\r\n        <block type=\"reports/product_viewed\" name=\"home.reports.product.viewed\" alias=\"product_viewed\" template=\"reports/home_product_viewed.phtml\" after=\"product_new\">\r\n            <action method=\"addPriceBlockType\">\r\n                <type>bundle</type>\r\n                <block>bundle/catalog_product_price</block>\r\n                <template>bundle/catalog/product/price.phtml</template>\r\n            </action>\r\n        </block>\r\n        <block type=\"reports/product_compared\" name=\"home.reports.product.compared\" template=\"reports/home_product_compared.phtml\" after=\"product_viewed\">\r\n            <action method=\"addPriceBlockType\">\r\n                <type>bundle</type>\r\n                <block>bundle/catalog_product_price</block>\r\n                <template>bundle/catalog/product/price.phtml</template>\r\n            </action>\r\n        </block>\r\n    </reference>\r\n    <reference name=\"right\">\r\n        <action method=\"unsetChild\"><alias>right.reports.product.viewed</alias></action>\r\n        <action method=\"unsetChild\"><alias>right.reports.product.compared</alias></action>\r\n    </reference>-->', NULL, NULL, NULL, NULL, NULL),
(3, 'About Us', 'one_column', NULL, NULL, 'about', NULL, '<div class=\"about_banner\">\r\n<div class=\"container\">\r\n<div class=\"about_banner_img\"><img alt=\"\" src=\"{{media url=\"wysiwyg/about_banner.jpg\"}}\" /></div>\r\n<div class=\"about_banner_text\">\r\n<p>M&amp;W Fashion Pvt. Ltd. Started its journey on August 2015. The first M&amp;W store was launched in Saltlake, at City Centre &ndash; I . We have already opened four Retail Showroom at City Centre , Burrabazar, Park Street, Rangoli Mall, Raghav Plaza (Hawrah AC), Durgapur (JCT Mall) &amp; Acropolis Mall.</p>\r\n<p>We also have an EBO of Jockey at Avani River Side Mall since 2012</p>\r\n<p>In coming days we are looking to be open 100 Showrooms shortly. M&amp;W Fashion Pvt. Ltd. is may be the first multi brand innerwear showroom in Kolkata.</p>\r\n<p>M&amp;W featured among 20 most-trusted brands all over world.</p>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"our_vision\">\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-sm-6\">\r\n<h3>Our Vision</h3>\r\n<p>To be a premium global conglomerate with a clear focus on each of the businesses.</p>\r\n</div>\r\n<div class=\"col-sm-6\">\r\n<h3>Our Mission</h3>\r\n<p>To deliver superior value to our customers, employees and society at large.</p>\r\n</div>\r\n</div>\r\n<div class=\"our_value\">\r\n<h3>Our Values</h3>\r\n<p>Integrity: Taking decision in a manner that is fair and honest following the highest Slandered of professionalism and being recognized for doing so. Integrity for us means not only financial and intellectual integrity, but encompasses all other forms as are generally understood.</p>\r\n<p>Commitment: On the foundation of Integrity, doing all that is needed to deliver value to all stakeholders. In the process, being accountable for our own actions and decisions, those of our team and those in the part of the organisation for which we are responsible.</p>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"co_founder\">\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-sm-6\"><img src=\"{{media url=\"wysiwyg/client.jpg\"}}\" alt=\"\" /></div>\r\n<div class=\"col-sm-6\">\r\n<h3>Our Founder &amp; CEO</h3>\r\n<h4>BAINAY KR DUBEY</h4>\r\n<p>In 2015, Binay Dubey has started M&amp;W -The Complete Innerwear Store, with an aim to change the way people shopped for Innerwear in India to offer every one the confidence, comfort &amp; choice they deserves. M&amp;W featured among 20 most-trusted brands all over world. Binay Dubey has a 15 years great experience in Genarel Trade having presence in different line of business. His Line of business includes both products &amp; services. We are one of the Largest Distributor, Retailer, wholesaler in inner-garments, Swimwear, Sportswear, Fabric and apparels Sector having Jockey, Speedo, TYR, Nike, Head, GM, Spalding, GoColors, Asics, Armani, CK, Amante, UCB, Chromozome, Jack &amp; Jones, Bwitch, Fcuk, Valentine, Mystere, Body Sculpture, Tonic , Lotto, DSC, UV&amp;W, Anvi as our business partners. Also have Modern Trade Business &lsquo;EBO of Jockey&rsquo; Since 2012 at Avani Riverside Mall, Howrah. We also have the biggest standalone showroom in the heart of Burabazaar under the brand name of Shree Shopper selling vast range of apparels, inner-wear, cosmetics, food, gift etc products. He is also a well known figure in real-estate, transportation business having its own 50 vehicles and also working as registered transporter for CASTROL INDIA. Currently we also added a new line of business (Food Sector) as a distributor of Patanjali Products. He is also a well know social worker having regular involvement in different social, educational &amp; health activities. He is also chairman of a NGO known as Kashi Prayag Bang Parishad and Seva darpan.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>', '2017-03-15 10:25:49', '2017-06-23 00:54:29', 1, 0, NULL, NULL, NULL, NULL, NULL, NULL),
