(5, 'Enable Cookies', 'one_column', NULL, NULL, 'enable-cookies', NULL, '<div class=\"std\">\n    <ul class=\"messages\">\n        <li class=\"notice-msg\">\n            <ul>\n                <li>Please enable cookies in your web browser to continue.</li>\n            </ul>\n        </li>\n    </ul>\n    <div class=\"page-title\">\n        <h1><a name=\"top\"></a>What are Cookies?</h1>\n    </div>\n    <p>Cookies are short pieces of data that are sent to your computer when you visit a website.\n    On later visits, this data is then returned to that website. Cookies allow us to recognize you automatically\n    whenever you visit our site so that we can personalize your experience and provide you with better service.\n    We also use cookies (and similar browser data, such as Flash cookies) for fraud prevention and other purposes.\n     If your web browser is set to refuse cookies from our website, you will not be able to complete a purchase\n     or take advantage of certain features of our website, such as storing items in your Shopping Cart or\n     receiving personalized recommendations. As a result, we strongly encourage you to configure your web\n     browser to accept cookies from our website.</p>\n    <h2 class=\"subtitle\">Enabling Cookies</h2>\n    <ul class=\"disc\">\n        <li><a href=\"#ie7\">Internet Explorer 7.x</a></li>\n        <li><a href=\"#ie6\">Internet Explorer 6.x</a></li>\n        <li><a href=\"#firefox\">Mozilla/Firefox</a></li>\n        <li><a href=\"#opera\">Opera 7.x</a></li>\n    </ul>\n    <h3><a name=\"ie7\"></a>Internet Explorer 7.x</h3>\n    <ol>\n        <li>\n            <p>Start Internet Explorer</p>\n        </li>\n        <li>\n            <p>Under the <strong>Tools</strong> menu, click <strong>Internet Options</strong></p>\n            <p><img src=\"{{skin url=\"images/cookies/ie7-1.gif\"}}\" alt=\"\" /></p>\n        </li>\n        <li>\n            <p>Click the <strong>Privacy</strong> tab</p>\n            <p><img src=\"{{skin url=\"images/cookies/ie7-2.gif\"}}\" alt=\"\" /></p>\n        </li>\n        <li>\n            <p>Click the <strong>Advanced</strong> button</p>\n            <p><img src=\"{{skin url=\"images/cookies/ie7-3.gif\"}}\" alt=\"\" /></p>\n        </li>\n        <li>\n            <p>Put a check mark in the box for <strong>Override Automatic Cookie Handling</strong>,\n            put another check mark in the <strong>Always accept session cookies </strong>box</p>\n            <p><img src=\"{{skin url=\"images/cookies/ie7-4.gif\"}}\" alt=\"\" /></p>\n        </li>\n        <li>\n            <p>Click <strong>OK</strong></p>\n            <p><img src=\"{{skin url=\"images/cookies/ie7-5.gif\"}}\" alt=\"\" /></p>\n        </li>\n        <li>\n            <p>Click <strong>OK</strong></p>\n            <p><img src=\"{{skin url=\"images/cookies/ie7-6.gif\"}}\" alt=\"\" /></p>\n        </li>\n        <li>\n            <p>Restart Internet Explore</p>\n        </li>\n    </ol>\n    <p class=\"a-top\"><a href=\"#top\">Back to Top</a></p>\n    <h3><a name=\"ie6\"></a>Internet Explorer 6.x</h3>\n    <ol>\n        <li>\n            <p>Select <strong>Internet Options</strong> from the Tools menu</p>\n            <p><img src=\"{{skin url=\"images/cookies/ie6-1.gif\"}}\" alt=\"\" /></p>\n        </li>\n        <li>\n            <p>Click on the <strong>Privacy</strong> tab</p>\n        </li>\n        <li>\n            <p>Click the <strong>Default</strong> button (or manually slide the bar down to <strong>Medium</strong>)\n            under <strong>Settings</strong>. Click <strong>OK</strong></p>\n            <p><img src=\"{{skin url=\"images/cookies/ie6-2.gif\"}}\" alt=\"\" /></p>\n        </li>\n    </ol>\n    <p class=\"a-top\"><a href=\"#top\">Back to Top</a></p>\n    <h3><a name=\"firefox\"></a>Mozilla/Firefox</h3>\n    <ol>\n        <li>\n            <p>Click on the <strong>Tools</strong>-menu in Mozilla</p>\n        </li>\n        <li>\n            <p>Click on the <strong>Options...</strong> item in the menu - a new window open</p>\n        </li>\n        <li>\n            <p>Click on the <strong>Privacy</strong> selection in the left part of the window. (See image below)</p>\n            <p><img src=\"{{skin url=\"images/cookies/firefox.png\"}}\" alt=\"\" /></p>\n        </li>\n        <li>\n            <p>Expand the <strong>Cookies</strong> section</p>\n        </li>\n        <li>\n            <p>Check the <strong>Enable cookies</strong> and <strong>Accept cookies normally</strong> checkboxes</p>\n        </li>\n        <li>\n            <p>Save changes by clicking <strong>Ok</strong>.</p>\n        </li>\n    </ol>\n    <p class=\"a-top\"><a href=\"#top\">Back to Top</a></p>\n    <h3><a name=\"opera\"></a>Opera 7.x</h3>\n    <ol>\n        <li>\n            <p>Click on the <strong>Tools</strong> menu in Opera</p>\n        </li>\n        <li>\n            <p>Click on the <strong>Preferences...</strong> item in the menu - a new window open</p>\n        </li>\n        <li>\n            <p>Click on the <strong>Privacy</strong> selection near the bottom left of the window. (See image below)</p>\n            <p><img src=\"{{skin url=\"images/cookies/opera.png\"}}\" alt=\"\" /></p>\n        </li>\n        <li>\n            <p>The <strong>Enable cookies</strong> checkbox must be checked, and <strong>Accept all cookies</strong>\n            should be selected in the &quot;<strong>Normal cookies</strong>&quot; drop-down</p>\n        </li>\n        <li>\n            <p>Save changes by clicking <strong>Ok</strong></p>\n        </li>\n    </ol>\n    <p class=\"a-top\"><a href=\"#top\">Back to Top</a></p>\n</div>\n', '2017-03-15 10:25:49', '2017-03-15 10:25:49', 1, 0, NULL, NULL, NULL, NULL, NULL, NULL),
(6, 'Privacy Policy', 'one_column', NULL, NULL, 'privacy-policy', 'Privacy Policy', '<div class=\"policy_pages\">\r\n<div class=\"container\">\r\n<h3>Privacy Policy</h3>\r\n<p><b>Collection of Information</b></p>\r\n<p>We collect information from you when you register on our site, place an order or fill out a form. When ordering or registering on our site, as appropriate, you may be asked to enter your name, e-mail address, mailing address, phone number or credit card information. You may, however, visit our site anonymously.</p>\r\n<p><b>Usage of Information</b></p>\r\n<p>Any of the information we collect from you may be used in one of the following ways:<br /> To personalize your experience</p>\r\n<p>Your information helps us to better respond to your individual needs<br /> To improve our website</p>\r\n<p>We continually strive to improve our website offerings based on the information and feedback we receive from you<br /> To improve customer service</p>\r\n<p>Your information helps us to more effectively respond to your customer service requests and support needs<br /> To process transactions</p>\r\n<p>Your information, whether public or private, will not be sold, exchanged, transferred, or given to any other company for any reason whatsoever, without your consent, other than for the express purpose of delivering the purchased product or service requested.<br /> To send periodic emails</p>\r\n<p>The email address you provide for order processing, may be used to send you information and updates pertaining to your order, in addition to receiving occasional company news, updates, related product or service information, etc.<br /> Protection of Information</p>\r\n<p>We implement a variety of security measures to maintain the safety of your personal information when you place an order or enter, submit, or access your personal information. We offer the use of a secure server. All supplied sensitive/credit information is transmitted via Secure Socket Layer (SSL) technology and then encrypted into our Payment gateway providers database only to be accessible by those authorized with special access rights to such systems, and are required to keep the information confidential.</p>\r\n<p>After a transaction, your private information (credit cards, social security numbers, financials, etc.) will not be stored on our servers.</p>\r\n<p><b>Use of Cookies</b></p>\r\n<p>Yes. Cookies are small files that a site or its service provider transfers to your computer&rsquo;s hard drive through your Web browser (if you allow) that enables the sites or service providers systems to recognize your browser and capture and remember certain information.</p>\r\n<p>We use cookies to help us remember and process the items in your shopping cart, understand and save your preferences for future visits and compile aggregate data about site traffic and site interaction so that we can offer better site experiences and tools in the future.</p>\r\n<p><b>Confidentiality</b></p>\r\n<p>We do not sell, trade, or otherwise transfer to outside parties your personally identifiable information. This does not include trusted third parties who assist us in operating our website, conducting our business, or servicing you, so long as those parties agree to keep this information confidential. We may also release your information when we believe release is appropriate to comply with the law, enforce our site policies, or protect ours or others rights, property, or safety. However, non-personally identifiable visitor information may be provided to other parties for marketing, advertising, or other uses.</p>\r\n<p><b>Third party links</b></p>\r\n<p>Occasionally, at our discretion, we may include or offer third party products or services on our website. These third party sites have separate and independent privacy policies. We therefore have no responsibility or liability for the content and activities of these linked sites. Nonetheless, we seek to protect the integrity of our site and welcome any feedback about these sites.</p>\r\n<p><b>Online Privacy Policy Only</b></p>\r\n<p>This online privacy policy applies only to information collected through our website and not to information collected offline.</p>\r\n<p><b>Terms and Conditions</b></p>\r\n<p>Please also visit our Terms and Conditions section establishing the use, disclaimers, and limitations of liability governing the use of our website m&amp;w.com/terms-of-use</p>\r\n<p><b>Changes to our Privacy Policy</b></p>\r\n<p>If we decide to change our privacy policy, we will post those changes on this page, and/or update the Privacy Policy modification date below.</p>\r\n<p><b>Contacting Us</b></p>\r\n<p>If there are any questions regarding this privacy policy you may contact us using our <a href=\"#\">Contact Information</a>.</p>\r\n</div>\r\n</div>', '2017-03-15 10:25:49', '2017-06-22 23:23:45', 1, 0, NULL, NULL, NULL, NULL, NULL, NULL),
(7, 'Shipping Policy', 'one_column', NULL, NULL, 'shipping-policy', NULL, '<div class=\"policy_pages\">\r\n    <div class=\"container\">\r\n        <h3>Shipping Policy</h3>\r\n        <p><b>Which are the courier services you use for the delivery of my order?</b></p>\r\n        <p>We use courier services of First Flight and Blue Dart to deliver your orders.</p>\r\n        <div class=\"v_spacer20\"></div>\r\n        <p><b>Please specify your domestic shipping rates</b></p>\r\n        <p>The rate charged for the shipping of your order is based on the following:</p>\r\n        <div class=\"row\">\r\n            <div class=\"col-sm-6\">\r\n                <p><b>Order Value</b><br>999 and above<br>Below 999<br>For orders above Rs. 999, shipping is absolutely free!</p>\r\n            </div>\r\n            <div class=\"col-sm-6\">\r\n                <p><b>Shipping Charges</b><br>Free Shipping<br>Rs 50.00</p>\r\n            </div>\r\n            \r\n        </div>\r\n        <div class=\"v_spacer20\"></div>\r\n        <p><b>How long would you take to deliver my order?</b></p>\r\n        <p>All orders are shipped within 48 hours. Please note that your order will be delivered within 5-6 business days. Any questions or concerns should be addressed to enquiry@M&W.com. Please include order confirmation number in the subject of email. We make sure to answer all emails within 24 hours.</p>\r\n        <div class=\"v_spacer20\"></div>\r\n        <p><b>What if I receive my order in a damaged condition?</b></p>\r\n        <p>We will absolutely make sure that you receive your order in a good condition. When your order arrives, please inspect the package for any damage that may have occurred during shipment. It is normal for the shipping package to show some wear, however, if damage has been occurred to the items in your shipment, please contact M&W Customer Service at 08050017676 between the hours of 10am to 7pm or send an email enquiry@M&W.com. We will be happy to assist you.</p>\r\n        <p>Please have a look at our <a href=\"#\">Return Policy</a>, if you would like to return the item(s) to us.</p>\r\n        <div class=\"v_spacer20\"></div>\r\n        <p><b>How do I track my orders ?</b></p>\r\n        <p>You can make use of the provision in our website to track your order online.</p>\r\n        <p>Below are some of the steps to trace your order.</p>\r\n        <ul>\r\n            <li>Please check your delivery confirmation or tracking number. This was sent to you from us via email/ sms. Sometimes these emails get sent to your junk/spam folder. Please go to http://www.M&W.com/my-account and track your order. Should you not be able to locate your order please contact us at 08050017676</li>\r\n            <li>Please make absolutely sure that you have given us the correct postal address and email address.</li>\r\n            <li>Please check if your delivery confirmation or tracking number’s time of delivery match your usual time of mail delivery.</li>\r\n            <li>Please check with your neighbor, in case your mail carrier has dropped your package with them or some other place when you aren’t home.</li>\r\n            <li>Please check if they left you a pick up notice.</li>\r\n            <li>Please contact your Postmaster at your post office to get further assistance, and report possible thefts.</li>\r\n        </ul>\r\n    </div>\r\n</div>', '2017-04-17 12:57:19', '2017-06-22 23:28:19', 1, 0, NULL, NULL, NULL, NULL, NULL, NULL),
(8, 'Terms and Conditions', 'one_column', NULL, NULL, 'terms-and-conditions', NULL, '<div class=\"policy_pages\">\r\n    <div class=\"container\">\r\n        <h3>Terms and Conditions</h3>\r\n        <p><b>1. Terms</b></p>\r\n        <p>By accessing this web site, you are agreeing to be bound by this website Terms and Conditions, all applicable laws and regulations, and agree that you are responsible for compliance with any applicable local laws. If you do not agree with any of these terms, you are prohibited from using or accessing this site. The materials contained in this web site are protected by applicable copyright and trade mark law.</p>\r\n        <p><b>2. User License</b></p>\r\n        <p>1. Permission is granted to temporarily download one copy of the materials (information or software) on this web site for personal, non-commercial transitory viewing only. This is the grant of a license, not a transfer of title, and under this license you may not:</p>\r\n        <p>1. Modify, reproduce, duplicate or copy the materials;<br>\r\n        2. use the materials for any commercial purpose, or for any public display (commercial or non-commercial);<br>\r\n        3. attempt to decompile or reverse engineer any software contained on this web site;<br>\r\n        4. remove any copyright or other proprietary notations from the materials; or<br>\r\n        5. Transfer the materials to another person or “mirror” the materials on any other server.<br>\r\n        2. This license shall automatically terminate if you violate any of these restrictions and may be terminated by M&W.com at any time. Upon terminating your viewing of these materials or upon the termination of this license, you must destroy any downloaded materials in your possession whether in electronic or printed format, or else shall be prosecuted as per law.</p>\r\n        <p><b>3. Limitations</b></p>\r\n        <p>In no event shall M&W.com or its suppliers be liable for any damages (including, without limitation, damages for loss of data or profit, or due to business interruption,) arising out of the use or inability to use the materials on M&W.com’s Internet site, even if M&W.com authorized representative has been notified orally or in writing of the possibility of such damage. Because some jurisdictions do not allow limitations on implied warranties, or limitations of liability for consequential or incidental damages, these limitations may not apply to you.</p>\r\n        <p><b>4. Revisions and Errata</b></p>\r\n        <p>The materials appearing on this web site could include technical, typographical, or photographic errors. M&W.com does not warrant that any of the materials on its web site are accurate, complete, or current. M&W.com may have a discretion to revise or make changes to these terms and conditions and the materials contained on this web site from time-to-time without notice. M&W.com does not, however, make any commitment to update the materials.</p>\r\n        <p><b>5. Links</b></p>\r\n        <p>M&W.com has not reviewed all of the sites linked to its Internet web site and is not responsible for the contents of any such linked site. The inclusion of any link does not imply endorsement by M&W.com of the site. Use of any such linked web site is at the user’s own risk.</p>\r\n        <p><b>6. Breach of terms and conditions</b></p>\r\n        <p>If you breach these terms and conditions in any way, M&W.com may take such action as it deems appropriate to deal with the breach, including suspending your access to the website, prohibiting you from accessing the website, blocking computers using your IP address from accessing the website, contacting your internet service provider to request that they block your access to the website and/or bringing court proceedings against you.</p>\r\n        <p><b>7. Indemnity</b></p>\r\n        <p>You hereby indemnify M&W.com and undertake to keep M&W.com indemnified against any losses, damages, costs, liabilities and expenses including legal expenses and any amounts paid by M&W.com to a third party in settlement of a claim or dispute incurred or suffered by M&W.com arising out of any breach or claim that you have breached any provision of this terms and conditions of this website.</p>\r\n        <p><b>8. Electronic Communications</b></p>\r\n        <p>When you visit M&W or send e-mails to us, you are communicating with us electronically. You consent to receive communications from us electronically. We will communicate with you by e-mail or by posting notices on this site. You agree that all agreements, notices, disclosures and other communications that we provide to you electronically satisfy any legal requirement that such communications be in writing.</p>\r\n        <p><b>9. Copyright</b></p>\r\n        <p>All content included on this site, such as text, graphics, logos, button icons, images, audio clips, digital downloads, data compilations, and software, is the property of M&W or its content suppliers and protected by international copyright laws. The compilation of all content on this site is the exclusive property of M&W, with copyright authorship for this collection by M&W, and protected by international copyright laws.</p>\r\n        <p><b>10. Trademarks</b></p>\r\n        <p>M&W trademarks and trade dress may not be used in connection with any product or service that is not M&W in any manner that is likely to cause confusion among customers, or in any manner that disparages or discredits M&W. All other trademarks not owned by M&W or its subsidiaries that appear on this site are the property of their respective owners, who may or may not be affiliated with, connected to, or sponsored by M&W or its subsidiaries.</p>\r\n        <p><b>11. License and Site Access</b></p>\r\n        <p>M&W grants you a limited license to access and make personal use of this site and not to download (other than page caching) or modify it, or any portion of it, except with express written consent of M&W. This license does not include any resale or commercial use of this site or its contents: any collection and use of any product listings, descriptions, or prices: any derivative use of this site or its contents: any downloading or copying of account information for the benefit of another merchant: or any use of data mining, robots, or similar data gathering and extraction tools. This site or any portion of this site may not be reproduced, duplicated, copied, sold, resold, visited, or otherwise exploited for any commercial purpose without express written consent of M&W. You may not frame or utilize framing techniques to enclose any trademark, logo, or other proprietary information (including images, text, page layout, or form) of M&W and our associates without express written consent. You may not use any meta tags or any other “hidden text” utilizing M&W name or trademarks without the express written consent of M&W. Any unauthorized use terminates the permission or license granted by M&W. You are granted a limited, revocable, and nonexclusive right to create a hyperlink to the home page of M&W, so long as the link does not portray M&W, its associates, or their products or services in a false, misleading, derogatory, or otherwise offensive matter. You may not use any weartin logo or other proprietary graphic or trademark as part of the link without express written permission.</p>\r\n        <p><b>12. Your Membership Account</b></p>\r\n        <p>If you use this site, you are responsible for maintaining the confidentiality of your account and password and for restricting access to your computer, and you agree to accept responsibility for all activities that occur under your account or password. If you are under 18, you may use our website only with involvement of a parent or guardian. M&W and its associates reserve the right to refuse service, terminate accounts, remove or edit content, or cancel orders in their sole discretion.</p>\r\n        <p><b>13. Reviews, Comments, Emails and other Content</b></p>\r\n        <p>Visitors may post reviews, comments, and other content: and submit suggestions, ideas, comments, questions, or other information, so long as the content is not illegal, obscene, threatening, defamatory, invasive of privacy, infringing of intellectual property rights, or otherwise injurious to third parties or objectionable and does not consist of or contain software viruses, political campaigning, commercial solicitation, chain letters, mass mailings, or any form of “spam.” You may not use a false e-mail address, impersonate any person or entity, or otherwise mislead as to the origin of a card or other content. M&W reserves the right (but not the obligation) to remove or edit such content, but does not regularly review posted content. If you do post content or submit material, and unless we indicate otherwise, you grant M&W and its associates a nonexclusive, royalty-free, perpetual, irrevocable, and fully sub licensable right to use, reproduce, modify, adapt, publish, translate, create derivative works from, distribute, and display such content throughout the world in any media. You grant M&W and its associates and sub licensees the right to use the name that you submit in connection with such content, if they choose. You represent and warrant that you own or otherwise control all of the rights to the content that you post: that the content is accurate: that use of the content you supply does not violate this policy and will not cause injury to any person or entity: and that you will indemnify M&W or its associates for all claims resulting from content you supply. M&W has the right but not the obligation to monitor and edit or remove any activity or content. M&W takes no responsibility and assumes no liability for any content posted by you or any third party.</p>\r\n        <p><b>14. Risk of Loss</b></p>\r\n        <p>All items purchased from M&W are made pursuant to a shipment contract. This basically means that the risk of loss and title for such items pass to you upon our delivery to the carrier.</p>\r\n        <p><b>15. Product Descriptions</b></p>\r\n        <p>M&W and its associates attempt to be as accurate as possible. However, M&W does not warrant that product descriptions or other content of this site is accurate, complete, reliable, current, or error-free. If a product offered by M&W itself is not as described, your sole remedy is to return it in unused condition.</p>\r\n        <p><b>16. Arbitration</b></p>\r\n        <p>Any dispute, controversy or claim arising out of or relating in any way to including without limitation any dispute concerning the validity, interpretation, enforceability or breach of the agreement, shall be exclusively resolved by binding arbitration upon a Party and M&W, or to products you purchase through M&W, shall be submitted to confidential arbitration , except that, to the extent you have in any manner violated or threatened to violate M&W intellectual property rights, M&W may seek injunctive or other appropriate relief from the court and you consent to exclusive jurisdiction and venue in such courts. Arbitration under this agreement shall be conducted under the rules then prevailing .The arbitrator’s award shall be binding and may be entered as a judgment in any court of competent jurisdiction. To the fullest extent permitted by applicable law, no arbitration under this Agreement shall be joined to an arbitration involving any other party subject to this Agreement, whether through class arbitration proceedings or otherwise.</p>\r\n        <p><b>17. Site Policies, Modification and Severability</b></p>\r\n        <p>Please review our other policies, such as our Shipping and Returns policy, posted on this site. These policies also govern your visit to M&W. We reserve the right to make changes to our site, policies, and these Conditions of use at any time. If any of these conditions shall be deemed invalid, void, or for any reason unenforceable, that condition shall be deemed severable and shall not affect the validity and enforceability of any remaining condition.</p>\r\n        <p><b>18. Governing Law</b></p>\r\n        <p>The terms and conditions of this website will be governed by and construed in accordance with the governing law of India, and any disputes relating to these terms and conditions will be subject to the non-exclusive jurisdiction of the courts in India.</p>\r\n        <p><b>19. Disclaimer and Warranties</b></p>\r\n        <p>The materials on M&W.com’s web site are provided “as is”. M&W.com makes no warranties, expressed or implied, and hereby disclaims and negates all other warranties, including without limitation, implied warranties or conditions of merchantability, fitness for a particular purpose, or non-infringement of intellectual property or other violation of rights. Further, M&W.com does not warrant or make any representations concerning the accuracy, likely results, or reliability of the use of the materials on its Internet web site or otherwise relating to such materials or on any sites linked to this site.</p>\r\n        <p>*pending for approval on copyright and trademark registration</p>\r\n    </div>\r\n</div>', '2017-04-17 13:11:43', '2017-06-22 23:29:17', 1, 0, NULL, NULL, NULL, NULL, NULL, NULL),
(9, 'Return Policy', 'one_column', NULL, NULL, 'return-policy', NULL, '<div class=\"policy_pages\">\r\n    <div class=\"container\">\r\n        <h3>Return Policy</h3>\r\n        <p>You are not happy with the product you ordered? It is not fitting you properly? Have we sent an incorrect product to you or is it damaged? In such cases, customers can go for easy and hassle-free returns, in exchange for a different product or a refund (Check <a href=\"#\">Refund Policy</a>)</p>\r\n        <div class=\"v_spacer20\"></div>\r\n        <p>Please go through the following policies for returns of the products delivered to you.</p>\r\n        <p>1. Please return the product within 15 days of delivery. Please ensure you return it with the original packaging & the return slip (Find it at the backside of the invoice)<br>\r\n2. Products such as briefs, swimwear, shapewear, any innerwear set that has brief in it, are not eligible for returns in order to maintain high standards of hygiene.<br>\r\n3. We will not accept the return of a product if it seems to be dirty/washed.<br>\r\n4. We shall not accept individual items when the products are sold as packs.<br>\r\n5. For returning of gifts, refund on gift packing will not be made.<br>\r\n6. No refund policy is applicable on products which are on sale during season promotions / stock clearance.</p>\r\n       <div class=\"v_spacer20\"></div>\r\n       <p>Please make sure that you are returning the product unwashed/free from dirt, along with the product tag, original invoice and original product packaging in the shipping box. Please give a call on 08050017676 or send an e-mail to enquiry@M&W.com to inform us about the returns immediately.</p>\r\n       <div class=\"v_spacer20\"></div>\r\n       <p>The returns can be shipped to following address through your preferred courier service. Your return shipping charges will be re-imbursed.</p>\r\n       \r\n       \r\n       <p><b>DieSachbearbeiter</b><br>\r\nChoriner Straße 49<br>\r\n10435 Berlin<br>\r\nE-Mail: moinsen@blindtextgenerator.com</p>\r\n        \r\n    </div>\r\n</div>', '2017-04-18 05:20:34', '2017-06-22 23:26:13', 1, 0, NULL, NULL, NULL, NULL, NULL, NULL),
(10, 'Refund Policy', 'one_column', NULL, NULL, 'refund-policy', NULL, '<div class=\"policy_pages\">\r\n    <div class=\"container\">\r\n        <h3>Refund Policy</h3>\r\n        <p>Kindly let us know immediately, in case you want to return the product and get a refund on it (does not include shipping charges). If you have made an online payment, your refund money will be credited to your account within 7 business days after we receive the product from you. In case you have made a cash-on delivery payment, we will require 15 business days to process the refund, once we receive the product from you.</p>\r\n        <div class=\"v_spacer20\"></div>\r\n        <p>Please make sure that you are returning the product unwashed/free from dirt, along with the product tag, original invoice and original product packaging in the shipping box. Please give a call on 08050017676 & send an e-mail to enquiry@m&w.com to inform us about the returns immediately.</p>\r\n        <div class=\"v_spacer20\"></div>\r\n        <p>The returns can be shipped to following address through your preferred courier service. Your return shipping charges will be re-imbursed.</p>\r\n   <p><b>DieSachbearbeiter</b><br>\r\nChoriner Straße 49<br>\r\n10435 Berlin<br>\r\nE-Mail: moinsen@blindtextgenerator.com</p>\r\n    </div>\r\n</div>', '2017-04-18 05:34:27', '2017-06-22 23:25:02', 1, 0, NULL, NULL, NULL, NULL, NULL, NULL),
(11, 'Disclaimer And Warranties', 'one_column', NULL, NULL, 'disclaimer-and-warranties', NULL, '<div class=\"policy_pages\">\r\n    <div class=\"container\">\r\n        <h3>Disclaimer and Warranties</h3>\r\n        The materials on m&w.com’s web site are provided “as is”. m&w.com makes no warranties, expressed or implied, and hereby disclaims and negates all other warranties, including without limitation, implied warranties or conditions of merchantability, fitness for a particular purpose, or non-infringement of intellectual property or other violation of rights. Further, m&w.com does not warrant or make any representations concerning the accuracy, likely results, or reliability of the use of the materials on its Internet web site or otherwise relating to such materials or on any sites linked to this site.\r\n    </div>\r\n</div>', '2017-04-18 05:42:10', '2017-06-22 23:30:32', 1, 0, NULL, NULL, NULL, NULL, NULL, NULL),
(12, 'Offer', 'one_column', NULL, NULL, 'offer', NULL, '{{block type=\"core/template\" template=\"cms/offer.phtml\"}}', '2017-04-18 06:26:37', '2017-04-18 06:35:23', 1, 0, NULL, NULL, NULL, NULL, NULL, NULL);
