(16, 'Our Investors', 'one_column', NULL, NULL, 'our-investors', NULL, '<div class=\"container\">\r\n<div class=\"our_investor_page\">\r\n<h2>Our <span>Investors</span></h2>\r\n<p>Over these few years, we have been able to garner strong investor support to build M&amp;W as one of India&rsquo;s most loved brands. No one ever imagined intimate wear for women to be mainstream and attention deserving. It is support from them that is helping us change this very notion.</p>\r\n</div>\r\n</div>', '2017-06-23 01:22:40', '2017-06-23 04:29:16', 1, 0, NULL, NULL, NULL, NULL, NULL, NULL),
